import { createRouter, createWebHistory } from "vue-router";
import Container from "../components/Container.vue";
import LoadingView from "../components/Loading.vue";


import HSD_API from "../components/LabTools/Sensor/HSD_API.vue";
import JenkinsAPI_N from "../components/LabTools/Sensor/JenkinsAPI-N.vue";
import JenkinsAPI_P from "../components/LabTools/Sensor/JenkinsAPI-P.vue";



import LabToolsMenu from "../components/LabTools/LabToolsMenu.vue";


import ReportReferenceMainUpdate from "@/components/LabTools/ASIC/ReportReferenceMainUpdate.vue";
import MasterExcelMain from "@/components/LabTools/ASIC/MasterExcelMain.vue";

import ManagementMenu from "../components/ManagementSystem/ManagementSystemMenu.vue";
import SensorFA from "@/components/ManagementSystem/Bussiness/SensorFA.vue";
import APTeamboard from "@/components/ManagementSystem/Bussiness/APTeamboard.vue";
import SensorTeamboard from "@/components/ManagementSystem/Bussiness/SensorTeamboard.vue";
import SectionTeamboard from "@/components/ManagementSystem/Bussiness/SectionTeamboard.vue";
import ICFA from "@/components/ManagementSystem/Bussiness/ICFA.vue";


import TrainingDocument from "@/components/ManagementSystem/Documents/Training.vue";


import EnrolmentandChecking from "@/components/ManagementSystem/Purchase/EnrolmentandChecking.vue";


import GeneralToolsMenu from "../components/GeneralTools/GeneralToolsMenu.vue";

import Home from "../components/Home.vue";
import Dashboard from "../components/Dashboard.vue";

const routes = [
  { path: "/", redirect: "/LabTools" },
  { path: "/home", component: Home },
  { path: "/dashboard", component: Dashboard, meta: { requiresAuth: true } },

  { path: "/", component: LoadingView },
  // LabTools
  {
    path: "/LabTools",
    component: Container,
    children: [
      {
        path: "",
        components: {
          menu: LabToolsMenu,
          main: LoadingView,
        },
      },
      {
        path: "Slice",
        components: {
          menu: LabToolsMenu,
          main: JenkinsAPI_N,
        },
      },
      {
        path: "Sensor/JenkinsAPI_N",
        components: {
          menu: LabToolsMenu,
          main: JenkinsAPI_N,
        },
      },
      {
        path: "Sensor/JenkinsAPI_P",
        components: {
          menu: LabToolsMenu,
          main: JenkinsAPI_P,
        },
      },
    
      {
        path: "Sensor/HSD_API",
        components: {
          menu: LabToolsMenu,
          main: HSD_API,
        },
      },
      {
        path: "ASIC/Reference",
        components: {
          menu: LabToolsMenu,
          //main: ReportReferenceMain,
        },
      },
      {
        path: "ASIC/UpdateReference",
        components: {
          menu: LabToolsMenu,
          main: ReportReferenceMainUpdate,
          meta: { requiresAuth: true },
        },
      },
      
      {
        path: "ASIC/MasterExcel",
        components: {
          menu: LabToolsMenu,
          main: MasterExcelMain,
        },
      },
    ],
  },
  // ManagementSystem
  {
    path: "/ManagementSystem",
    // name: 'Compare',
    component: Container,
    children: [
      {
        path: "",
        components: {
          menu: ManagementMenu,
          main: LoadingView,
        },
      },
      {
        path: "Capacity/Assessment",
        components: {
          menu: ManagementMenu,
          //main: CapacityAssessmentMain,
        },
      },
    ],
  },
  // Bussiness
  {
    path: "/ManagementSystem",
    component: Container,
    children: [
      {
        path: "",
        components: {
          menu: ManagementMenu,
          main: LoadingView,
        },
      },
      {
        path: "Bussiness/ICFA",
        components: {
          menu: ManagementMenu,
          main: ICFA,
        },
      },
      {
        path: "Bussiness/SensorFA",
        components: {
          menu: ManagementMenu,
          main: SensorFA,
        },
      },
      {
        path: "Bussiness/APTeamboard",
        components: {
          menu: ManagementMenu,
          main: APTeamboard,
        },
      },
      {
        path: "Bussiness/SensorTeamboard",
        components: {
          menu: ManagementMenu,
          main: SensorTeamboard,
        },
      },
      {
        path: "Bussiness/SectionTeamboard",
        components: {
          menu: ManagementMenu,
          main: SectionTeamboard,
        },
      },
    ],
  },
  // Documents
  {
    path: "/ManagementSystem",
    component: Container,
    children: [
      {
        path: "",
        components: {
          menu: ManagementMenu,
          main: LoadingView,
        },
      },
      {
        path: "Documents/Training",
        components: {
          menu: ManagementMenu,
          main: TrainingDocument,
        },
      },
    ],
  },
  // Equipment
  {
    path: "/ManagementSystem",
    component: Container,
    children: [
      {
        path: "",
        components: {
          menu: ManagementMenu,
          main: LoadingView,
        },
      },
      {
        path: "Equipment/WI",
        components: {
          menu: ManagementMenu,
          //main: WI,
        },
      },
      {
        path: "Equipment/TPM",
        components: {
          menu: ManagementMenu,
          //main: TPM,
        },
      },
    ],
  },
  // Purchase
  {
    path: "/ManagementSystem",
    component: Container,
    children: [
      {
        path: "",
        components: {
          menu: ManagementMenu,
          main: LoadingView,
        },
      },
      {
        path: "Purchase/EnrolmentandChecking",
        components: {
          menu: ManagementMenu,
          main: EnrolmentandChecking,
        },
      },
    ],
  },
 
  // GeneralTools
  {
    path: "/GeneralTools",
    component: Container,
    children: [
      {
        path: "",
        components: {
          menu: GeneralToolsMenu,
          main: LoadingView,
        },
      },
    ],
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
